imageUpload.writeFunction:
{
	const event = Structr.this;

	const base64String = Structr.get('value');
	if (base64String && base64String.length > 0) {

		const eventFolder = Structr.getOrCreate('Folder', 'name', 'events');
		const eventImagesFolder = Structr.getOrCreate('Folder', 'name', Structr.clean(event.name) + '-' + event.id, 'parent', eventFolder);

		const newImage = Structr.create('EventImage',
			'name', 'uploaded-image-' + Structr.get('now').toISOString() + '.img',
			'visibleToAuthenticatedUsers', true,
			'parent', eventImagesFolder,
			'base64Data', base64String);

		Structr.log('created image ', newImage);

		event.images.push(newImage);

	}

}

