imageUpload.writeFunction:
{
	const member = Structr.this;

	const base64String = Structr.get('value');
	if (base64String && base64String.length > 0) {

		const membersFolder = Structr.getOrCreate('Folder', 'name', 'members');
		const memberImagesFolder = Structr.getOrCreate('Folder', 'name', Structr.clean(member.eMail) + '-' + member.id, 'parent', membersFolder);

		const newImage = Structr.create('Image',
			'name', 'uploaded-image-' + Structr.get('now').toISOString() + '.img',
			'visibleToAuthenticatedUsers', true,
			'parent', memberImagesFolder,
			'owner', member,
			'base64Data', base64String);

		Structr.log('created image ', newImage);

		member.img = newImage;

	}

}
